column5:
The four static properties in the TextDecorations class are already of type TextDecorationCollection, e.g. :public static TextDecorationCollection Strikethrough { get; }Apparently they aren't meant to be combined.So instead of adding any of them to your TextDeco property, just set the property like this:TextDeco = TextDecorations.Strikethrough; You may however combine two TextDecorations like this: TextDeco = new TextDecorationCollection( Enumerable.Concat(TextDecorations.Strikethrough, TextDecorations.Underline));Or more, by recursively calling Concat: TextDeco = new TextDecorationCollection(
    Enumerable.Concat(TextDecorations.Strikethrough,
        Enumerable.Concat(TextDecorations.Underline, TextDecorations.OverLine)));
